CREATE TABLE Animals(
   ID             INTEGER NOT NULL PRIMARY KEY 
  ,Name           VARCHAR(11)
  ,BirthDate      DATE NOT NULL
  ,AnimalType     VARCHAR(3) NOT NULL
  ,Sex            VARCHAR(13) NOT NULL
  ,Breed          VARCHAR(36) NOT NULL
  ,Description    VARCHAR(19) NOT NULL
  ,AdoptionStatus VARCHAR(6) NOT NULL
);
